import React from "react";

class WordEntry extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            word: null
        }
    }

    setupWordLesson(data) {
        this.setState({
            word: data[0]["word"]
        })
    }

    render() {
        return (
            <h2>{this.state.word}</h2>
        );
    }
}

export default WordEntry;
